import React from "react";

function Text() {
  return (
    <h3 className="mb-3">
      Look who we are, we are the dreamers. We make it happen 'cause we can see
      it. [Post-Chorus] Here's to the ones, that keep the passion
    </h3>
  );
}

export default Text;
